#include<bits/stdc++.h>
using namespace std;

int bsearch(vector<int> v,int l,int r,int x){
    if(l<=r){
        int mid = (l+r)/2;
        if(v[mid]==x){
            return mid;
        }
        else if(v[mid]<x){
            return bsearch(v,mid+1,r,x);
        }
        return bsearch(v,l,mid-1,x);
    }
    return -1;
}
vector<int> twoSum(vector<int>& numbers, int target) {
    vector<int> res;
    unordered_map<int,bool> m;
    for(auto x:numbers){
        m[x]=true;
    }
    for(int i=0;i<numbers.size();i++){
        int x = target-numbers[i];
        int ind=-1;
        if(x>numbers[i] && m[x]){
            ind = bsearch(numbers,i+1,numbers.size()-1,x);
        }
        else if(m[x]){
            ind = bsearch(numbers,0,i-1,x);
        }
        //cout<<i<<" "<<ind<<endl;
        if(ind!=-1 && ind!=i){
            res={min(ind,i)+1,max(ind,i)+1};
        }
    }
    return res;
}
